import ReactDOM from 'react-dom/client';
import './index.css';
import { BrowserRouter as Router, Routes, Route, Link, useLocation,Navigate  } from 'react-router-dom';
import { AuthProvider } from './context/AuthContext';
import { navItems } from './data/users'; // 更改為 users.js
import { PrivateRoute } from './components/PrivateRoute';
import Home from './pages/Home';
import NewData from './pages/Page1/NewData';
import HomeData from './pages/Page1/HomeData';
import LoginKey from './pages/Page1/LoginKey';
import Register from './pages/Register';
import Login from './pages/Login';
import Page1 from './pages/Page1';
import Page2 from './pages/Page2';
import Page3 from './pages/Page3';
import ProductData from './pages/Page1/ProductData';
import PortfolioData from './pages/Page1/PortfolioData';
import React, { useEffect, useState } from 'react';
import './index.css';
import TitleImg from './components/TitleImg';
import AboutMe from './components/AboutMe';
import MarketEvent from './components/MarketEvent';
import AnimateOnScroll from './components/AnimateOnScroll';

const App = () => {
    const [scrollPosition, setScrollPosition] = useState(0);

    useEffect(() => {
        const handleScroll = () => {
            setScrollPosition(window.pageYOffset);
        };
        window.addEventListener('scroll', handleScroll);
        return () => window.removeEventListener('scroll', handleScroll);
    }, []);

    return (
        <div className="parallax-container">
            <div className="title-section">
                <TitleImg />
            </div>

            <div 
                className="content-section"
                style={{ 
                    transform: `translateY(${scrollPosition * -0.3}px)` 
                }}
            >
                <AnimateOnScroll>
                    <div>
                        <MarketEvent />
                    </div>
                </AnimateOnScroll>
                <AnimateOnScroll>
                    <div>
                        <AboutMe />
                    </div>
                </AnimateOnScroll>
            </div>
        </div>
    );
};

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    <React.StrictMode>
        <App />
    </React.StrictMode>
);
